import React, {useState} from "react";
import axios from "axios";
import {serverPath} from "../App";
import {BrowserRouter as Router, Route, Routes, useLocation, useNavigate, useParams} from "react-router-dom";

function Project(props)
{
    axios.post(serverPath + "/user/getProject", {username: props.username, projectId: props.projectId}).then(res => {
        console.log(res.data);
        if(res.data !== "error") {
            console.log("success");
            document.getElementById("projectName" + props.projectId).innerHTML = res.data.projectName;
            document.getElementById("projectDes" + props.projectId).innerHTML = res.data.projectShortDescription;
        }
    }).catch(err => {
        console.log(err);
    });

    return(
        <div className="col-md-6 col-lg-4">
            <div className="card border-0">
                <a href={"/" + props.username + "/projects/" + props.projectId}>
                    <img className="card-img-top scale-on-hover" src="assets/img/nature/image1.jpg" alt="Card Image"/>
                </a>
                <div className="card-body">
                    <h6>
                        <a href="#" id={"projectName" + props.projectId}>
                            Lorem Ipsum
                        </a>
                    </h6>
                    <p className="text-muted card-text" id={"projectDes" + props.projectId}>
                        Lorem ipsum dolor sit amet, consectetur
                        adipiscing elit. Nunc quam urna.
                    </p>
                </div>
            </div>
        </div>
    )
}


function ProjectView(props) {
    console.log(window);

    let params = (new URL(document.location)).searchParams;
    let token = params.get("projectId");
    let projectId = document.location.pathname.toString().split("/")[3];

    axios.post(serverPath + "/user/getProject", {username: props.username, projectId: projectId}).then(res => {
        console.log(res.data);
        if (res.data !== "error") {
            console.log("success");
            document.getElementById("projectName").innerHTML = res.data.projectName;
            document.getElementById("projectDes" ).innerHTML = res.data.projectLongDescription;
        }
    }).catch(err => {
        console.log(err);
    });

    return (
        <main className="page projects-page">
            <section className="portfolio-block projects-cards">
                <div className="container">
                    <div className="heading">
                        <h2 id={"projectName"}></h2>
                    </div>
                        <div className="card border-0">

                            <div className="card-body">
                                <img className="card-img-top scale-on-hover" src="assets/img/nature/image1.jpg" alt="Card Image"/>
                                <p className="text-muted card-text" id={"projectDes"}>
                                    Lorem ipsum dolor sit amet, consectetur
                                    adipiscing elit. Nunc quam urna.
                                </p>
                            </div>
                    </div>
                </div>
            </section>
        </main>
    )
}

export function Projects(props) {

    const [projects, setProjects] = useState([]);
    for (let i = 0; i < 2; i++) {

        setProjects([...projects, `${<Project projectId={i} username={props.username}/>} ${projects.length}`]);
        projects.push();
     }
    // axios.post(serverPath + "/user/getProjectCount", {username: props.username}).then(res => {
    //    
    // }).catch(err => {
    //     console.log(err);
    // });




    return (
        <div>
                <Routes>
                    <Route path="/:projectId" element={<ProjectView username={props.username}/>}/>
                </Routes>
            {
                window.location.pathname === "/" + props.username + "/projects" ?
                    <main className="page projects-page">
                        <section className="portfolio-block projects-cards">
                            <div className="container">
                                <div className="heading">
                                    <h2>Projects</h2>
                                </div>
                                <div className="row" id={"projects"}>
                                    {projects}
                                    <div className="col-md-6 col-lg-4">
                                        <div className="card border-0"><a href="#"><img
                                            className="card-img-top scale-on-hover" src="assets/img/nature/image3.jpg"
                                            alt="Card Image"/></a>
                                            <div className="card-body">
                                                <h6><a href="#">Lorem Ipsum</a></h6>
                                                <p className="text-muted card-text">Lorem ipsum dolor sit amet, consectetur
                                                    adipiscing elit. Nunc quam urna.</p>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="col-md-6 col-lg-4">
                                        <div className="card border-0"><a href="#"><img
                                            className="card-img-top scale-on-hover" src="assets/img/nature/image4.jpg"
                                            alt="Card Image"/></a>
                                            <div className="card-body">
                                                <h6><a href="#">Lorem Ipsum</a></h6>
                                                <p className="text-muted card-text">Lorem ipsum dolor sit amet, consectetur
                                                    adipiscing elit. Nunc quam urna.</p>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="col-md-6 col-lg-4">
                                        <div className="card border-0"><a href="#"><img
                                            className="card-img-top scale-on-hover" src="assets/img/nature/image5.jpg"
                                            alt="Card Image"/></a>
                                            <div className="card-body">
                                                <h6><a href="#">Lorem Ipsum</a></h6>
                                                <p className="text-muted card-text">Lorem ipsum dolor sit amet, consectetur
                                                    adipiscing elit. Nunc quam urna.</p>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="col-md-6 col-lg-4">
                                        <div className="card border-0"><a href="#"><img
                                            className="card-img-top scale-on-hover" src="assets/img/nature/image6.jpg"
                                            alt="Card Image"/></a>
                                            <div className="card-body">
                                                <h6><a href="#">Lorem Ipsum</a></h6>
                                                <p className="text-muted card-text">Lorem ipsum dolor sit amet, consectetur
                                                    adipiscing elit. Nunc quam urna.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </section>
                    </main>
                    :
                    <div>
                    </div>
            }

        </div>
    );
}
